{\pard \ql \f0 \sa180 \li0 \fi0 Non oversampled clipper based on anti derivative anti aliasing methods as described in this paper (the math is a bit over my head lol)... https://dafx16.vutbr.cz/dafxpapers/20-DAFx-16_paper_41-PN.pdf controls...\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Drive: Level compensated clipping drive\par}
