{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Strict Clip: Second clipping stage to catch peaks cuased by high restore\par}
{\pard \ql \f0 \sa0 \li360 \fi-360 \bullet \tx360\tab Out: Output level\sa180\par}
