{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Octave Fuzz\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Full Wave rectifier type effect can make some signals appear octave higher, but using distortion. Best used on monophonic sounds, or power chords! High frequency transients should pass through almmost untouched, so you can mangle a vocal, into a chipmunk/gnome/elf and still hear the esses!\par}
}

