{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Retro Distortion\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Versatile saturation/distortion effect. Three stages of non-linear distortion one - tanh soft clipper two - a blend of 2nd harmonic and a distortion that works at all signal levels! three - tanh soft clipper Controls - . Headroom Less headroom = more distortion from clippers and optional 2nd harmonic. . Distortion More 2nd harmonic and/or dynamic variable distortion. . Dynamic Mix Blends in the dynamic variable distortion. . out gain Output level\par}
}

