{\pard \ql \f0 \sa180 \li0 \fi0 \b \fs36 Blue Vocal Compressor (beta)\par}
{\pard \ql \f0 \sa180 \li0 \fi0 Smooth clean Opto compressor/limiter with ratio, attack, release controls and featuring colourfull output stage Controls... input gain : input gainstaging less ess : feed high frquency transients to the detector to prevent ess sounds getting louder Compression Drive : Increases compression, output compensated Output Drive : Push the output stage harder for more dirt and colour Compress - Limit : Compress = feedback 2:1 Limit = Feedforward inf:1 Attack time : Aprox time for full gain reduction Release Time : Aprox time for gain reduction to return to 0dB after level drops exact release time is dependant on amount of gain reduction and length of time in compression\par}
}

